import React from 'react';
import './ProgramsDetail.css';

const GlobalStudies = () => {
  return (
    <div className="program-detail">
      <div className="program-hero" style={{ backgroundImage: `url('https://images.unsplash.com/photo-1523050854058-8df90110c9f1?ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80')` }}>
        <div className="hero-overlay"></div>
        <div className="hero-content">
          <h1>Global Studies</h1>
          <p>International perspective and language immersion to prepare students for a globalized world.</p>
        </div>
      </div>
      <div className="program-content">
        <h2>About Global Studies</h2>
        <p>Our Global Studies program emphasizes cultural awareness, language learning, and international collaboration. Students gain the skills needed to thrive in a globalized world.</p>
        <img src="https://images.unsplash.com/photo-1523050854058-8df90110c9f1?ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80" alt="Global Studies" />
      </div>
    </div>
  );
};

export default GlobalStudies;
